import icomeImg from '../../assets/entradas.svg';
import { Container } from "./styles";

export function Summary (){
    return (
        <Container>
            <div>
                <header>
                    <p>Entradas</p>
                    <img src={icomeImg} alt="Entradas" />
                </header>
            </div>
        </Container>
    );
}
